import React from 'react'
import { Paper } from '@material-ui/core'


export default function Haiku({ title, text, user }) {
    return (
        <Paper style={{ display: "inline-block", margin: "1rem" }}>
            <h1 style={{ textAlign: "center" }}>{title}</h1>
            <div style={{ margin: "1rem" }}>{text}</div>
            <div style={{ textAlign: "center", margin: "1rem", fontWeight: "bold" }}>-{user}</div>
            <i style={{ color: "green" }} class="fas fa-thumbs-up"></i>
            <i style={{ color: "red" }} class="fas fa-thumbs-down"></i>
        </Paper>
    )
}
